  false,\n\t\"url\": null,\n\t\"notes\": \"This data set describes wells (excluding
  observation wells) that are completed in the Arikaree aquifer and that were used
  to create a map of the generalized potentiometric surface of the Arikaree aquifer
  in the Pine Ridge Indian Reservation and Bennett County. Water levels in the wells
  were measured by a variety of people including the well drillers and U.S. Geological
  Survey personnel. The water-level data for this data set are based on the most recent
  measured value for the well through 2006. The range in water-level data for this
  data set was from 1929 to 2006. All water levels were retrieved from the U.S. Geological
  Survey's NWISWeb database at http://nwis.waterdata.usgs.gov/sd/nwis/gwlevels.\",\n\t\"license_title\":
